import React from 'react';
import './Body.css';

function Body(props){
    return(
        <div className="bodyEstilo">
           <p>{props.tituloPractica}</p>
           <p>{props.arreglo}</p>
           {props.arreglo.map((item, index) => (
                <Item key={index} item={item} />
            ))}
        </div>
    );
}

export default Body;
